import React from 'react'

export default function Profile() {
    return (

        <div
          style={{
            display: "flex",
            width: "100%",
            height: "100%",
            flexFlow: "column",
            alignItems: "center",
          }}
        >
          <div
            style={{
              display: "flex",
              justifyContent: "space-between",
              flexFlow: "row",
            }}
          >
            <div>
              <img

                style={{
                  position: "absolute",
                  top: "40%",
                  left: "50%",
                  transform: "translate(-50%, -50%)",
                  zIndex: 1,
                }}
              />

              <img

                // className={classes.homeImage}
                alt={"homeImage"}
                width="100%"
                height="50%"
                style={{
                  position: "relative",
                  boxShadow:
                    "0 4px 8px 0 rgba(0, 0, 0, 0.2), 0 6px 20px 0 rgba(0, 0, 0, 0.19)",
                  left: "0px",
                }}
              />
            </div>
          </div>
          </div>
    )
}
